def trailingZeroes(n, b):
    count = 0
    while n >= b:
        count += n // b
        n //= b
    return count

if __name__ == '__main__':
    n, b = map(int, input().split())
    print(trailingZeroes(n, b))










































































































































































































































































































def trailingZeroes(n, b):
    count = 0
    while n // b != 0:
        count += n // b
        n //= b
    return count

n, b = list(map(int, input().split()))
print(trailingZeroes(n, b))

def trailing_zeros(n, b):
    factorial = 1
    for i in range(1, n + 1):
        factorial *= i
    factorial = str(factorial)
    count = 0
    for i in range(len(factorial) - 1, -1, -1):
        if int(factorial[i]) == 0:
            count += 1
        else:
            break
    return count

print(trailing_zeros(int(input()), int(input())))

import sys

n, b = map(int, sys.stdin.readline().split())

def factorial(n, b):
    if n == 0:
        return 1
    else:
        return n * factorial(n - 1, b)

print(len([i for i in str(factorial(n, b)) if i == '0']))
